import React from 'react';
import { 
  Layout,
  Page
} from '@shopify/polaris';

import { userContext } from './userContext';
import Form from './components/Form'

function App() {
    return (
      <userContext.Provider value={this.state.user}>
        <Page title="Polaris">
          <Layout>
            <Layout.Section>
              <Form />
            </Layout.Section>
          </Layout>
        </Page>
      </userContext.Provider>
    );
}

export default App
